import React from "react";

interface TaskListItemProps {
    task: Task;
}


export const TaskListItem: React.FC<TaskListItemProps> = ({
    task,
  }) => {
    return (
    <tr>
        <td><input type="checkbox"></input> {task.username}</td>
        <td>{task.phone}</td>
        <td>{task.email}</td>
        <td>
            <span className="align-text-bottom">
            { task.complete ? <img src="./icons/checkmark.png"></img> : null }                
            </span>
             {task.date.toDateString()}
        </td>
        <td>
            <button><img src="./icons/view.png"></img>צפייה</button>
            <button><img src="./icon/edit.png"></img>עריכה</button>
            <button><img src="./icons/delete.png"></img>מחיקה</button>
        </td>
    </tr>  
    );
};
